var thisBody = document.body; 
var div = document.createElement("div"); 
var isLoaded;
div.style.paddingTop="30px"
div.style.position="absolute"
div.style.left="0"
div.style.top="0"
div.style.zIndex="99999"
div.id="vader-loading"
div.style.width="100%"
div.style.height="100%"
div.style.background="#000"
div.style.opacity="0"
div.innerHTML='<div><img src="data:image/jpg;base64,"></div><div id="vader-title" style="width:246px;height:110px;background:#000;margin:10px auto 0px auto;"><div id="vader-progress" style="width:0%;height:110px;background:#ccc;"><img src="data:image/png;base64,"></div></div><div style="margin-top:10px"><span style="color: #707070;font: bold 18px Gulim;letter-spacing:1px;">THE ULTIMATE SOUNDTRACK COLLECTION<br>MUSIC COMPOSED AND CONDUCTED BY JOHN WILLIAMS</span></div>'
thisBody.appendChild(div); 

var progress=0
var progressID
var loadingDiv=document.getElementById("vader-loading")
var vaderProgress=document.getElementById("vader-progress")
var loadingDivOpacity=0
var selfAdd=1;

progressID = window.setInterval(fadeIn,10)


function fadeIn(){
	if(loadingDivOpacity<1){
		loadingDiv.style.opacity=loadingDivOpacity
		loadingDivOpacity+=0.01
	}
	else{
		clearInterval(progressID)
		progressID = window.setInterval(start,10)
		}
	
}

function fadeOut(){
	if(loadingDivOpacity>0){
		loadingDiv.style.opacity=loadingDivOpacity
		loadingDivOpacity-=0.01
	}
	else{
		clearInterval(progressID)
		loadingDiv.style.display="none"
		isLoaded=true;
	}
	
}



function start(){
    if(progress<1000){
        vaderProgress.style.width=progress/10+"%"
        progress+=selfAdd;
    }
    else{
        clearInterval(progressID)
		progressID = window.setInterval(fadeOut,10)
    }
}


document.onreadystatechange = function(){     
        if(document.readyState=="complete")     
        {     
        selfAdd=5
        }   
}   



